import React, { useState, useEffect } from 'react'
import axios from 'axios'
function HomePage() {
    const [data, setData] = useState([])
    useEffect(() => {
        axios.get('https://bing.com/covid/data').then((res: any) => {
            setData(data)
        })
    }, [])
    return (
        <div>
            Welcome to Next.js!
        </div>
    )
}

export default HomePage
